import image from "../image.webp";

const Card = (prop) => {
    // Generate random image URL

    return (
      <div className="card-container">
        <div className="card">
          <div className="content">
            <div className="imgBx">
              <img src={image} alt="Random" />
            </div>
            <div className="contentBx">
              <h3>
                Giraffe
                <br />
                <span>Happy Birthday</span>
              </h3>
            </div>
          </div>
          <ul className="sci">
            <li>
              <a href="#">happy</a>
            </li>
          </ul>
        </div>
      </div>
    );
  };
  
  export default Card;
